<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN">
<html>
	<head>
		<title></title>
	</head>
	<body>
	    <div id="parametersTypesDialog" title="Select a parameter type">
            <div id="parameterTypesAccordion">                
                <h3>Constant</h3> 
                <div id="slides" >
                    <div class="slides_container">
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "Boolean" >
                                <img alt="Boolean" src= "css/img/boolean.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "DateTime" >  
                                <img alt="DateTime" src="css/img/datetime.png" />
                            </a>
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "Duration" >
                                <img alt="Duration" src="css/img/duration.png" />
                            </a>
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "Floating" >
                                <img alt="Floating" src="css/img/floating.png"  />
                            </a>                            
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "Numeric" >
                                <img alt="Numeric" src="css/img/numeric.png" />
                            </a>
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "String" >
                                <img alt="String" src="css/img/string.png" />
                            </a>
                        </div>
                    </div>
                    <a href="#" class="prev">
                        <img src="css/img/arrow-prev.png" width="24" height="43" alt="Arrow Prev"/>
                    </a>
				    <a href="#" class="next">
                        <img src="css/img/arrow-next.png" width="24" height="43" alt="Arrow Next"/>
                    </a>
                </div>
                <h3>Distributions</h3> 
                <div id="slides_two">
                    <div class="slides_container">
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "BetaDistribution" >
                                <img alt="Beta" src="css/img/beta.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "BinomialDistribution" >
                                <img alt="Binomial" src="css/img/binomial.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "ErlangDistribution" >
                                <img alt="Erlang" src="css/img/erlang.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "GammaDistribution" >
                                <img alt="Gamma" src="css/img/gamma.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "LogNormalDistribution" >
                                <img alt="LogNormal" src="css/img/lognormal.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "NegativeExponentialDistribution" >
                                <img alt="Negative Exponential" src="css/img/negativeexponential.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "NormalDistribution" >
                                <img alt="Normal" src="css/img/normal.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "PoissonDistribution" >
                                <img alt="Poisson" src="css/img/poisson.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "TriangularDistribution" >
                                <img alt="Triangular" src="css/img/triangular.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "TruncatedNormalDistribution" >
                                <img alt="Truncated Normal" src="css/img/truncatednormal.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "UniformDistribution" >
                                <img alt="Uniform" src="css/img/uniform.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "UserDistribution" >
                                <img alt="User" src="css/img/user.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "WeibullDistribution" >
                                <img alt="Weibull" src="css/img/weibull.png" />
                            </a> 
                        </div>
                    </div>
                    <a href="#" class="prev">
                        <img src="css/img/arrow-prev.png" width="24" height="43" alt="Arrow Prev"/>
                    </a>
				    <a href="#" class="next">
                        <img src="css/img/arrow-next.png" width="24" height="43" alt="Arrow Next"/>
                    </a>
                </div> 
                <h3>Others</h3> 
                <div id="slides_three">
                    <div class="slides_container">
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "Expression" >
                                <img alt="Expression" src="css/img/expression.png" />
                            </a> 
                        </div>
                        <div>
                            <a href="#" class= "parameterTypeLink" data-type= "Enumeration" >
                                <img alt="Enumeration" src="css/img/enumeration.png" />
                            </a> 
                        </div>
                    </div>
                    <a href="#" class="prev">
                        <img src="css/img/arrow-prev.png" width="24" height="43" alt="Arrow Prev"/>
                    </a>
				    <a href="#" class="next">
                        <img src="css/img/arrow-next.png" width="24" height="43" alt="Arrow Next"/>
                    </a>
                </div> 
            </div> 
        </div> 
	</body>
</html>
